    if ($checkboxSpecificContainer.CheckState -eq 'Checked')
    {
      foreach ($Item in $ous_listview.Items)
      {
        $Item.checked = $false
        $ous_listview.Enabled = $false
      } # end foreach
      $btnBrowseAD.Enabled = $true
    } # end if
    else
    {
      if ($checkboxSpecificContainer.CheckState -eq 'Unchecked')
      {
        foreach ($Item in $ous_listview.Items)
        {
          $Item.checked = $true
        } # end foreach
        $btnBrowseAD.Enabled = $false
      } # end if
    } # end else
  } # end
  #endregion

  #region tbGroups clear
  $tbGroups_MouseClick = [System.Windows.Forms.MouseEventHandler]{
    $tbGroups.Clear()
  }
  #endregion

  #region Clear Query
  $btnClearADQuery_Click = {
    $lvOUs.Items.Clear()
    #$btnRunQuery.Enabled = $false
    $btnSaveADQuery.Enabled = $false
    $btnClearADQuery.Enabled = $false
  } # end
  #endregion

  #region Save Query
  $btnSaveADQuery_Click = {
    $SaveADQuery = New-Object System.Windows.Forms.SaveFileDialog
    $ScriptDirectory = Get-ScriptDirectory
    # TODO make dynamic
    $SaveADQuery.initialDirectory = "$($ScriptDirectory)\data\ADQueries\"
    $SaveADQuery.ShowHelp = $true
    $SaveADQuery.Title = 'AD Info Save query'
    $SaveADQuery.filter = 'AD Info Query Files|*.qry'
    $SaveADQuery.FileName = 'DefaultQuery'
    $result = $SaveADQuery.ShowDialog()
    if ($result -eq [System.Windows.Forms.DialogResult]::OK)
    {
      foreach ($Item in $lvOUs.Items)
      {
        $Item.Text | Out-File -LiteralPath $SaveADQuery.FileName -Append
      } # end foreach
      else
      {
        # oops!
      } # end else
    } # end if
  } # end
  #endregion

  #region Load Query
  $btnLoadADQuery_Click = {
    $lvOUs.Items.Clear()
    $LoadADQuery.InitialDirectory = "$($ScriptDirectory)\data\ADQueries\"
    $LoadADQuery.FileName = ''
    $LoadADQuery.Title = 'AD Info Load Query'
    $LoadADQuery.Filter = 'AD Info Query Files|*.qry'
    $result = $LoadADQuery.ShowDialog()

    if ($result -eq [System.Windows.Forms.DialogResult]::OK)
    {
      $loadQuery = Get-Content $LoadADQuery.FileName

      foreach ($query in $loadQuery)
      {
        $lvOUs.Items.Add($query)
      } # end foreach

      if ($lvOUs.Items.Count -gt 0)
      {
        $btnSaveADQuery.Enabled = $true
        $btnClearADQuery.Enabled = $true
        $btnRunQuery.Enabled = $true
      } # end if
    } # end if
    else
    {
      # oops!
    } # end else
  } # end
  #endregion

  #region tbGroups search button
  $tbGroups_KeyDown = [System.Windows.Forms.KeyPressEventHandler]{
    if ($_.KeyCode -eq 'Enter')
    {
      $btnGroupsSearch_Click -eq $true
    } # end if
  } # end
  #endregion

  #region Show GridView
  $btnGridView_Click = {
    $results = $Global:query | Out-GridView -Title "Count: $($Global:query.count)   -  Select single or Multiple entries to export to CSV" -PassThru
    if ($results -ne $null)
    {
      $Global:query = $results
      $sbp3.Text = "Count: $($results.count)"
      Write-Host $results.count
      $btnGridView.Enabled = $false
    } # end if
    else
    {
      Write-Host 'no go'
    } # end else
  } # end
  #endregion

  $buttonUpdate_Click = {
    $autocomplete = Get-QADGroup -SizeLimit 0 |
    Select-Object samaccountname |
    Format-Table -HideTableHeaders
    $autocomplete | Out-File -FilePath "$($ScriptDirectory)\autocomplete.txt"
    [IO.File]::ReadAllText("$($ScriptDirectory)\autocomplete.txt") -replace '\s+\r\n+', "`r`n" | Out-File "$($ScriptDirectory)\autocomplete.txt"
  }

  $buttonBrowse_Click = {
    $ScriptDirectory = Get-ScriptDirectory
    $null = [System.Reflection.Assembly]::loadfile("$($ScriptDirectory)\ADTreeViewWpf.dll")
    $null = [System.Reflection.Assembly]::loadfile("$($ScriptDirectory)\Cjwdev.WindowsApi.dll")
    $null = [System.Reflection.Assembly]::LoadWithPartialName('System.Windows.Forms')

    $adDialog = New-Object ADTreeViewWpf.SelectContainerDialog
    $adDialog.AllowMultipleSelections = $true
    $adDialog.ShowDialog()

    ForEach ($SelectedOU In $adDialog.SelectedContainers)
    {
      $SelectedOU = ConvertFrom-DN $SelectedOU
      $lvOUs.Items.Add($SelectedOU)
      $btnRunQuery.Enabled = $true
      if ($lvOUs.Items.Count -gt 0)
      {
        $btnSaveADQuery.Enabled = $true
        $btnClearADQuery.Enabled = $true
      } # end if
    } # end foreach
  }

